  2007 School Readiness (SR-NHES:2007), is a study that is part of the National Household
  Education Survey (NHES) program. SR-NHES:2007 (http://nces.ed.gov/nhes/) is a cross-sectional
  survey that collects data directly from households on educational issues. This study
  was conducted using address based sample, self-administered questionnaires of households.
  Households in 2007 were sampled. The studyufffds response rate was 53.2 percent.
  Key statistics produced from SR-NHES:2007 are childrenufffds readiness for school.\",\n\t\"license_title\":
